import './App.css';
import SearchIcon from './search.svg';

const App = () =>{


  return (
    <div className="app">
    <h1>My Fitness</h1>

    <div className="search">
      <input 
      placeholder="Search"
      value="Cardio"
      onChange={() => {}}
      />
      <img src={SearchIcon}
      alt="search"
      onClick={()=>{}}
      />
    </div>
    <div className="container">
      <div className="movie">
        <div>
        <p>Hello</p>
        </div>
        <div>
      <img src='https://w0.peakpx.com/wallpaper/300/278/HD-wallpaper-gym-weights-bodybuilder-bodybuilding-cardio-dumbell-muscle-running-sweat-weight-workout.jpg' alt="400Image"/>
        </div>
        <div>
          <span>Cardio</span>
          <h3>Weight Loss</h3>
        </div>
    </div>
    </div>
    </div>
  );
}

export default App;
